import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";

const HomePage = () => {
  // Animations
  const headerVariants = {
    hidden: { opacity: 0, y: -50 },
    visible: { opacity: 1, y: 0, transition: { duration: 1 } },
  };

  const titleVariants = {
    hidden: { opacity: 0, y: 50 },
    visible: { opacity: 1, y: 0, transition: { duration: 1.2, delay: 0.2 } },
  };

  const subtitleVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0, transition: { duration: 1, delay: 0.5 } },
  };

  const buttonVariants = {
    hover: {
      scale: 1.05,
      backgroundColor: "#fcd34d",
      color: "#000",
      boxShadow: "0px 0px 20px #fcd34d",
      transition: { duration: 0.3 },
    },
    tap: { scale: 0.95 },
  };

  const footerVariants = {
    hidden: { opacity: 0 },
    visible: { opacity: 1, transition: { duration: 1, delay: 1 } },
  };

  const floatingVariants = {
    animate: {
      y: [0, -20, 0],
      x: [0, 20, 0],
      transition: { duration: 6, repeat: Infinity, ease: "easeInOut" },
    },
  };

  return (
    <div className="relative min-h-screen flex flex-col overflow-hidden bg-gradient-to-br from-[#0f172a] via-[#1e293b] to-[#0f172a]">
      {/* Video Background */}
      <video
        autoPlay
        loop
        muted
        className="absolute inset-0 w-full h-full object-cover z-0 brightness-75"
        src="hd.mp4"
        type="video/mp4"
      />

      {/* Floating Blobs */}
      <motion.div
        className="absolute top-20 left-10 w-40 h-40 bg-yellow-400 rounded-full opacity-30 blur-3xl z-5"
        variants={floatingVariants}
        animate="animate"
      />
      <motion.div
        className="absolute top-1/2 right-20 w-60 h-60 bg-pink-400 rounded-full opacity-20 blur-3xl z-5"
        variants={floatingVariants}
        animate="animate"
      />
      <motion.div
        className="absolute bottom-10 left-1/3 w-32 h-32 bg-purple-500 rounded-full opacity-25 blur-3xl z-5"
        variants={floatingVariants}
        animate="animate"
      />

      {/* Overlay */}
      <div className="absolute inset-0 bg-black/50 z-10"></div>

      {/* Main Content */}
      <div className="relative z-20 min-h-screen flex flex-col">
        {/* Header */}
        <motion.header
          variants={headerVariants}
          initial="hidden"
          animate="visible"
          className="flex items-center justify-between px-8 py-5 backdrop-blur-md"
        >
          <motion.div
            className="text-5xl font-extrabold text-white cursor-pointer"
            style={{ fontFamily: '"Kablammo", system-ui' }}
            whileHover={{ scale: 1.1, color: "#facc15" }}
          >
            Matty
          </motion.div>

          <nav className="flex items-center gap-8 text-white">
            <motion.div whileHover={{ scale: 1.1, color: "#fcd34d" }}>
              <Link to="/about" className="hover:underline">
                About Us
              </Link>
            </motion.div>

            <motion.div whileHover={{ scale: 1.1, color: "#fcd34d" }}>
              <a href="#">Our Blog</a>
            </motion.div>

            <motion.div whileHover={{ scale: 1.1, color: "#fcd34d" }}>
              <a href="#">Contact Us</a>
            </motion.div>

            <motion.div whileHover={buttonVariants.hover} whileTap={buttonVariants.tap}>
              <Link
                to="/login"
                className="px-6 py-2 rounded-full border border-white text-white font-semibold bg-transparent transition-all duration-300"
              >
                Login
              </Link>
            </motion.div>
          </nav>
        </motion.header>

        {/* Hero Section */}
        <main className="flex-1 flex flex-col items-center justify-center px-6 text-center relative">
          <motion.h1
            variants={titleVariants}
            initial="hidden"
            animate="visible"
            className="text-5xl md:text-6xl font-extrabold leading-tight text-white mb-4"
          >
            Think, plan, and create
            <br />
            <motion.span
              variants={subtitleVariants}
              initial="hidden"
              animate="visible"
              className="text-yellow-400 font-normal"
            >
              all in one place
            </motion.span>
          </motion.h1>

          <motion.p
            variants={subtitleVariants}
            initial="hidden"
            animate="visible"
            className="text-lg md:text-xl text-gray-200 mb-12 max-w-xl"
          >
            Efficiently design, organize, and save your creative work with Matty.
          </motion.p>

          <motion.div variants={buttonVariants} whileHover="hover" whileTap="tap">
            <Link
              to="/register"
              className="text-3xl px-12 py-5 rounded-full border border-white text-white font-semibold bg-transparent transition-all duration-300"
            >
              Start Designing
            </Link>
          </motion.div>
        </main>

        {/* Footer */}
        <motion.footer
          variants={footerVariants}
          initial="hidden"
          animate="visible"
          className="py-6 text-center text-gray-200 text-sm border-t border-gray-500/20"
        >
          &copy; 2025 Matty. All rights reserved.
        </motion.footer>
      </div>
    </div>
  );
};

export default HomePage;
